import React from "react";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import MvEmail from "../generalLayout/mvEmail";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
const heroGradientStart = "#252524";
const heroGradientEnd = "#222121";
const dragster800rosso_infor = {
  namePage: "Dragster 800 Rosso",
  price: "13.400",
  nameHeaderTitle: "dragster800rosso/dragster-800-rosso.svg",
  bgHeaderParallax: "dragster800rosso/dragster-800-rosso-xl.png",
  manifesto_Arr: ["YOUR", "DREAM", "STARTS", "HERE"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "All the guts, the power and the character of a true Dragster. Accessible, pure riding pleasure.",
  Model3ds: [
    {
      link: [
        "dragster800rosso/original/dragster800rosso_0.png",
        "dragster800rosso/original/dragster800rosso_1.png",
        "dragster800rosso/original/dragster800rosso_2.png",
        "dragster800rosso/original/dragster800rosso_3.png",
        "dragster800rosso/original/dragster800rosso_4.png",
        "dragster800rosso/original/dragster800rosso_5.png",
        "dragster800rosso/original/dragster800rosso_6.png",
        "dragster800rosso/original/dragster800rosso_7.png",
        "dragster800rosso/original/dragster800rosso_8.png",
        "dragster800rosso/original/dragster800rosso_9.png",
        "dragster800rosso/original/dragster800rosso_10.png",
        "dragster800rosso/original/dragster800rosso_11.png",
        "dragster800rosso/original/dragster800rosso_12.png",
        "dragster800rosso/original/dragster800rosso_13.png",
        "dragster800rosso/original/dragster800rosso_14.png",
        "dragster800rosso/original/dragster800rosso_15.png",
        "dragster800rosso/original/dragster800rosso_16.png",
        "dragster800rosso/original/dragster800rosso_17.png",
        "dragster800rosso/original/dragster800rosso_18.png",
        "dragster800rosso/original/dragster800rosso_19.png",
        "dragster800rosso/original/dragster800rosso_20.png",
        "dragster800rosso/original/dragster800rosso_21.png",
        "dragster800rosso/original/dragster800rosso_22.png",
        "dragster800rosso/original/dragster800rosso_23.png",
        "dragster800rosso/original/dragster800rosso_24.png",
        "dragster800rosso/original/dragster800rosso_25.png",
        "dragster800rosso/original/dragster800rosso_26.png",
        "dragster800rosso/original/dragster800rosso_27.png",
        "dragster800rosso/original/dragster800rosso_28.png",
        "dragster800rosso/original/dragster800rosso_29.png",
        "dragster800rosso/original/dragster800rosso_30.png",
        "dragster800rosso/original/dragster800rosso_31.png",
        "dragster800rosso/original/dragster800rosso_32.png",
        "dragster800rosso/original/dragster800rosso_33.png",
        "dragster800rosso/original/dragster800rosso_34.png",
        "dragster800rosso/original/dragster800rosso_35.png",
      ],
      color:
        "linear-gradient(45deg, rgba(45,0,12,1) 25%, rgba(121,9,9,1) 50%, rgba(255,0,0,1) 100%)",
      nameOfColor: "ahihi",
    },
  ],
};
export default function Dragster800Rosso() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: dragster800rosso_infor.colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={dragster800rosso_infor.namePage}></PageName>
      <MotorPageHeader
        manifesto_Arr={dragster800rosso_infor.manifesto_Arr}
        nameHeaderTitle={dragster800rosso_infor.nameHeaderTitle}
        titleSize="auto 18%"
        colorBg={dragster800rosso_infor.colorBg}
        contentHeaderContent={dragster800rosso_infor.contentHeaderContent}
        price={dragster800rosso_infor.price}
        bgHeaderParallax={dragster800rosso_infor.bgHeaderParallax}
        reveredContent={false}
        heightContentTop="14.5%"
      />
      <Motor3d models={dragster800rosso_infor.Model3ds} />
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
